--------     ---------------------------------------
  SELECT Channel,
       SUM(Spend_GBP) AS Total_Spend
  FROM marketing_campaign_dataset30
  GROUP BY Channel
  ORDER BY Total_Spend DESC;

  ------- ?       ---------------------------------
 SELECT City, 
       SUM(Profit) AS Total_Profit
FROM marketing_campaign_dataset30
GROUP BY City
ORDER BY Total_Profit DESC;

  ------ Profit  --------------------------------------------------
  SELECT Campaign,
       SUM(Profit) AS Total_Profit
FROM marketing_campaign_dataset30
GROUP BY Campaign
ORDER BY Total_Profit DESC;

------   (Desktop vs Mobile)    (Conversions).-----
SELECT Device, 
       SUM(Conversions) AS Total_Conversions
FROM marketing_campaign_dataset30
GROUP BY Device;

-------    ?.-------------------------------------------------
SELECT MONTH(Date) AS Month, 
       SUM(Spend_GBP) AS Total_Spend
FROM marketing_campaign_dataset30
GROUP BY MONTH(Date)
ORDER BY Month;

--------       (Likes + Shares + Comments).-----------
SELECT City, 
       SUM(Likes + Shares + Comments) AS Total_Engagement
FROM marketing_campaign_dataset30
GROUP BY City
ORDER BY Total_Engagement DESC;

